import React, { useEffect } from "react";
import { View, ScrollView, SafeAreaView } from "react-native";
import { useSelector } from "react-redux";
import { useDispatch } from "react-redux";
import { allCharacter } from "../../redux/actions/actions";
import Cardd from "../card/card";
export default function Cards() {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(allCharacter());
  }, [dispatch]);

  const characters = useSelector((state) => state.character.results);

  return (
    <View>
      <SafeAreaView>
        <ScrollView>
          {characters &&
            characters.map((phones) => {
              return (
                <View key={phones.id}>
                    <Cardd
                      id={phones.id}
                      name={phones.name}
                      species={phones.species}
                      image={phones.image}
                    />
                </View>
              );
            })}
        </ScrollView>
      </SafeAreaView>
    </View>
  );
}
